import React from 'react';
import './AboutPage.css';

const AboutPage = () => {
  return (
    <div className="about-page">
      <h1>About Me</h1>
      <p>
        I am a passionate and dedicated Full Stack Developer with expertise in JavaScript, React.js, and Node.js.
        I enjoy building scalable and performant web applications using modern technologies.
      </p>
      <p>
        With a strong background in front-end development, I specialize in creating dynamic user interfaces and
        engaging user experiences. I am well-versed in responsive design principles and strive to make websites
        accessible to a wide range of users.
      </p>
      <p>
        On the back-end, I have experience working with Node.js and creating RESTful APIs. I am proficient in database
        technologies like MongoDB and MySQL, and I have a solid understanding of server-side development and API integrations.
      </p>
      <p>
        As a lifelong learner, I am constantly exploring new technologies and staying up to date with industry best practices.
        I am passionate about collaborating with teams and leveraging my skills to deliver innovative solutions.
      </p>
    </div>
  );
};

export default AboutPage;
